import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './HealthCondition.css';

const filterOptions = [
  "Bone and Joint Care",
  "Digestive Care",
  "Eye Care",
  "Pain Relief",
  "Smoking Cessation",
  "Liver Care",
  "Cold and Cough",
  "Heart Care",
  "Kidney Care",
  "Respiratory Care",
  "Mental Wellness",
  "Derma Care"
];

const products = [
  { name: 'Calcium Tablets', subcategory: 'Bone and Joint Care', price: 220, image: '/images/bone-care.jpg' },
  { name: 'Probiotic Capsules', subcategory: 'Digestive Care', price: 180, image: '/images/digestive.jpg' },
  { name: 'Antacid Tablets', subcategory: 'Digestive Care', price: 100, image: '/images/stomach.jpg' },
  { name: 'Eye Drops', subcategory: 'Eye Care', price: 60, image: '/images/eye-care.jpg' },
  { name: 'Pain Relief Spray', subcategory: 'Pain Relief', price: 130, image: '/images/pain-relief.jpg' },
  { name: 'Nicotine Patches', subcategory: 'Smoking Cessation', price: 300, image: '/images/smoking.jpg' },
  { name: 'Liver Detox Syrup', subcategory: 'Liver Care', price: 150, image: '/images/liver.jpg' },
  { name: 'Cough Syrup', subcategory: 'Cold and Cough', price: 120, image: '/images/cough.jpg' },
  { name: 'Heart Health Capsules', subcategory: 'Heart Care', price: 250, image: '/images/heart.jpg' },
  { name: 'Kidney Support Tablets', subcategory: 'Kidney Care', price: 200, image: '/images/kidney.jpg' },
  { name: 'Inhaler', subcategory: 'Respiratory Care', price: 180, image: '/images/respiratory.jpg' },
  { name: 'Mood Support Capsules', subcategory: 'Mental Wellness', price: 270, image: '/images/mental.jpg' },
  { name: 'Anti-Acne Gel', subcategory: 'Derma Care', price: 160, image: '/images/derma.jpg' },
];

const HealthCondition = () => {
  const navigate = useNavigate();

  const handleCategoryClick = (option) => {
    const routes = {
      "Bone and Joint Care": "/health-conditions/bone-joint",
      "Digestive Care": "/health-conditions/digestive",
      "Eye Care": "/health-conditions/eye",
      "Pain Relief": "/health-conditions/pain",
      "Smoking Cessation": "/health-conditions/smoking",
      "Liver Care": "/health-conditions/liver",
      "Cold and Cough": "/health-conditions/cold-cough",
      "Heart Care": "/health-conditions/heart",
      "Kidney Care": "/health-conditions/kidney",
      "Respiratory Care": "/health-conditions/respiratory",
      "Mental Wellness": "/health-conditions/mental",
      "Derma Care": "/health-conditions/derma"
    };

    if (routes[option]) {
      navigate(routes[option]);
    }
  };

  const groupedProducts = filterOptions.map((subcategory) => ({
    subcategory,
    items: products.filter((p) => p.subcategory === subcategory)
  }));

  return (
    <div className="healthcondition-container container py-4">
      {/* Hero Section */}
      <div className="hero-section text-center mb-5">
        <h1 className="display-5 fw-bold text-primary">🩺 Health Condition Products</h1>
        <p className="lead text-muted">Targeted care for every health need—from joints to mental wellness</p>
      </div>

      {/* Category Cards */}
      <div className="row justify-content-center mb-5">
        {filterOptions.map((option) => (
          <div key={option} className="col-md-2 col-6 mb-3">
            <div
              className="category-card text-center shadow-sm"
              onClick={() => handleCategoryClick(option)}
            >
              <img
                src={`/images/${option.toLowerCase().replace(/ /g, '-')}.png`}
                alt={option}
                className="category-icon mb-2"
              />
              <h6 className="text-primary">{option}</h6>
            </div>
          </div>
        ))}
      </div>

      {/* Grouped Product Cards */}
      <div className="row">
        {groupedProducts.map(({ subcategory, items }) => (
          items.length > 0 && (
            <div key={subcategory} className="col-md-6 mb-4">
              <div className="category-showcase-card shadow-sm p-3 rounded">
                <h5 className="text-primary mb-3">{subcategory}</h5>
                <div className="d-flex flex-wrap gap-3">
                  {items.map((product, index) => (
                    <div key={index} className="mini-product-card text-center">
                      <img src={product.image} alt={product.name} className="mini-product-image mb-2" />
                      <div className="fw-semibold">{product.name}</div>
                      <div className="text-success">₹{product.price}</div>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          )
        ))}
      </div>
    </div>
  );
};

export default HealthCondition;
